code.value:
RFE_ERROR_GUARD
{
    rfeHwReg_fusaPointer fusaPointer = rfeHwReg_internalPointer( base, offset );

    if ( fusaPointer.isFusa )
    {
        bool comparison = false;
        uint8_t round = 0;

        do
        {
            *fusaPointer.pointer = value;
            comparison = ( value == *fusaPointer.pointer );
            round++;
        } while ( ( !comparison ) && ( round < RFE_HW_REG_FUSA_BOUNDED_RETRY_MAX ) );

        if ( comparison )
        {
            // Comparison successful within the bounded retry limit
        }
        else
        {
            RFE_ERROR_SET( rfe_error_registerComparisonFailed_e );
        }
    }
    else
    {
        *fusaPointer.pointer = value;
    }
}

rfeHwReg_register32_t result = 0ul;

RFE_ERROR_GUARD
{
    rfeHwReg_fusaPointer fusaPointer = rfeHwReg_internalPointer( base, offset );

    if ( fusaPointer.isFusa )
    {
        bool comparison = false;
        uint8_t round = 0;

        do
        {
            result = *fusaPointer.pointer;
            comparison = ( *fusaPointer.pointer == result );
            round++;
        } while ( ( !comparison ) && ( round < RFE_HW_REG_FUSA_BOUNDED_RETRY_MAX ) );

        if ( comparison )
        {
            // Comparison successful within the bounded retry limit
        }
        else
        {
            RFE_ERROR_SET( rfe_error_registerComparisonFailed_e );
        }
    }
    else
    {
        result = *fusaPointer.pointer;
    }
}

return result;

rfeHwReg_register32_t regValue = rfeHwReg_read( base, offset, RFE_ERROR_FUNCTION_ARGUMENT );

regValue &= ( ~mask );
regValue |= ( value & mask );

rfeHwReg_write( base, offset, regValue, RFE_ERROR_FUNCTION_ARGUMENT );

if ( value )
{
    rfeHwReg_setBit( base, offset, bit, RFE_ERROR_FUNCTION_ARGUMENT );
}
else
{
    rfeHwReg_clearBit( base, offset, bit, RFE_ERROR_FUNCTION_ARGUMENT );
}

rfeHwReg_register32_t result;

if ( value )
{
    result = rfeHwReg_util_setBit( reg, bit );
}
else
{
    result = rfeHwReg_util_clearBit( reg, bit );
}

return result;

rfeHwReg_fusaPointer result;

result.pointer = (volatile uint32_t*)( ( (char*)( 0 ) ) + ( ( base + offset ) & RFE_HW_REG_POINTER_MSK ) );
result.isFusa = ( ( offset & RFE_HW_REG_OFFSET_FUSA_MODE_MSK ) == RFE_HW_REG_OFFSET_FUSA_MODE_BIT );

return result;
